    /**
     * @inheritDoc
     */
    public function load(ObjectManager $manager) {
        $students = json_decode($this->students);

        $this->loadSekIStudents($manager, $students);
        $this->loadSekIIStudents($manager, $students);
        $manager->flush();
    }

    private function loadSekIIStudents(ObjectManager $manager, array $students) {
        $grades = GradeFixtures::getSekIIGradeNames();
        $startIndex = 300;
        $size = 60;

        foreach($grades as $gradeName) {
            $grade = $manager->getRepository(Grade::class)
                ->findOneBy([
                    'externalId' => $gradeName
                ]);

            for($i = $startIndex; $i < $startIndex + $size; $i++) {
                $student = $students[$i];
                $entity = $this->getStudentFromObject($student);

                $entity
                    ->setExternalId($i)
                    ->setGrade($grade);

                $manager->persist($entity);
            }

            $startIndex += $size;
        }
    }

    private function loadSekIStudents(ObjectManager $manager, array $students) {
        $grades = GradeFixtures::getSekIGradeNames();
        $startIndex = 0;
        $size = 20;

        foreach($grades as $id => $name) {
            $grade = $manager->getRepository(Grade::class)
                ->findOneBy([
                    'externalId' => $id
                ]);

            for($i = $startIndex; $i < $startIndex + $size; $i++) {
                $student = $students[$i];
                $entity = $this->getStudentFromObject($student);

                $entity
                    ->setExternalId($i)
                    ->setGrade($grade);

                $manager->persist($entity);
            }

            $startIndex += $size;
        }
    }

    private function getStudentFromObject($student) {
        return (new Student())
            ->setGender(new Gender($student->gender))
            ->setStatus('aktiv')
            ->setIsFullAged(false)
            ->setLastname($student->surname)
            ->setFirstname($student->name)
            ->setEmail($this->generateEmail($student->name, $student->surname));
    }

    private function generateEmail(string $firstname, string $lastname) {
        return mb_strtolower(sprintf('%s.%s@students.school.it', $firstname, $lastname));
    }

    /**
     * @inheritDoc
     */
    public function getDependencies() {
        return [
            GradeFixtures::class
        ];
    }
